import React from "react";
import Footer from "../components/Footer";

const MyProfile = () => {
  return (
    <div className="min-h-screen flex flex-col justify-between bg-gray-100">

      {/* -------- TOP HERO SECTION WITH BACKGROUND IMG -------- */}
      <div
        className="w-full h-52 md:h-64 bg-cover bg-center relative flex items-center justify-center"
        style={{
          backgroundImage: "url('your-image.jpg')", // ⭐ यहाँ अपनी image का लिंक डालना
        }}
      >
        {/* Overlay Dark Shade */}
        <div className="absolute inset-0 bg-black/50"></div>

        {/* TITLE TEXT */}
        <h1 className="relative text-white text-3xl md:text-4xl font-bold tracking-wide drop-shadow-lg">
          My Dashboard
        </h1>
      </div>

      {/* -------- PROFILE CONTENT -------- */}
      <div className="flex-grow px-4 py-10 max-w-3xl mx-auto">

        <div className="bg-white shadow-lg rounded-xl p-6">
          <h2 className="text-xl font-semibold mb-4 text-[#0A2540]">
            My Profile
          </h2>

          <div className="space-y-3 text-gray-700">
            <p><strong>Name:</strong> Demo User</p>
            <p><strong>Email:</strong> demo@example.com</p>
            <p><strong>Phone:</strong> +91 9876543210</p>
            <p><strong>Joined:</strong> January 2025</p>
          </div>
        </div>

      </div>

      <Footer />
    </div>
  );
};

export default MyProfile;
